      Testsysteme: 'ZBI',
      Frontend_Elemente: '',
      Frontend_Elemente_vorbereitet: false,
      Datenbank_Elemente:
        'Index:\r\nKB_Beauftragung (CIX_KB_Beauftragung_kb_beauftrtyp_id_hauptauftrag_kb_beauftr_id)\r\nDMS_KB_Beauftragung (CIX_DMS_KB_Beauftragung_obj_id_sb_id)\r\n\r\nProzedur:\r\nproc_dms_standarddateien_Neuanlage\r\n\r\n-- Skript mit ausführen bei Release:\r\n-- DMS-Standardvorlage "Beauftragung Ausdruck" hinterlegen, wo nicht bereits "Beauftragung Vertrag" hinterlegt ist\r\nUPDATE\tKB_Beauftragung_Typ\r\nSET\t\tkb_beauftrtyp_dms_vertrag_pt_dms_stb_pi_id = 6\r\nWHERE\tkb_beauftrtyp_dms_vertrag_pt_dms_stb_pi_id IS NULL\r\n\r\n-- Nachträge auf selben DMS-Standardvorlage Wert setzen wie Hauptauftrag, wenn Nachtrag für diesen Typ aktiv ist, ansonsten leer (NULL)\r\nUPDATE\tKB_Beauftragung_Typ\r\nSET\t\tkb_beauftrtyp_nachtrag_dms_vertrag_pt_dms_stb_pi_id\r\n\t\t= CASE \r\n\t\t\tWHEN kb_beauftrtyp_nachtrag_aktiv = 0 THEN NULL\r\n\t\t\tELSE kb_beauftrtyp_dms_vertrag_pt_dms_stb_pi_id\r\n\t\t  END',
      Sprint_Name_aktiv: '',
      Version_Name: '2019.26.01',
      Version_ReleaseDate: '2019-06-27T22:00:00.000Z',
