        "Prozedur:\r\n[P_DML_ATN_Mitarbeiter_Zuordnung]\r\n\r\nSkript:\r\n-- Abweichendes Erledigt-Datum/MA in ATN und MA-Zuordnung korrigieren\r\nUPDATE\tATN\r\nSET\t\t  atn_erledigt_ma_id\t= atn_maz_ma_id\r\n\t\t, atn_erledigt_dat\t\t= atn_maz_erledigt_dat\r\n\t\t, atn_aen_dat\t\t\t= GETDATE ()\r\n\t\t, atn_aen_user\t\t\t= 1\r\nFROM    ATN\r\n        INNER JOIN    ATN_Mitarbeiter_Zuordnung ON atn_id = atn_maz_atn_id\r\nWHERE   -- Aufgabe\r\n\t\tatn_pt_atn_typ_id = 1\r\n\t\t-- Durchführender\r\n        AND atn_maz_pt_mar_id = 2\r\n\t\t-- Durchführender hat die Aufgabe als 'erledigt' gekennzeichnet\r\n        AND atn_maz_erledigt_dat > '19000101'\r\n\t\t-- erledigt Datum oder MA weicht in ATN ab\r\n        AND (atn_maz_erledigt_dat <> ISNULL (atn_erledigt_dat, '19000101')\r\n\t\t\t OR atn_maz_ma_id <> ISNULL (atn_erledigt_ma_id, 0)\r\n\t\t\t)\r\n",
      Sprint_Name_aktiv: '',
      Version_Name: '2019.42.01',
      Version_ReleaseDate: '2019-10-17T22:00:00.000Z',
