      Datenbank_Elemente:
        'P_SEL_EB_Beleg_Statuswechsel\r\n\r\nStammdatenbereinigung von bestehenden Aufgabenweiterleitungen:\r\nLöschen der Status-Folgestatus-Zuordnung\r\n\r\n\t\tSELECT\t\tast.eb_bstat_id\r\n\t\t\t\t\t, fost.eb_bstat_id\r\n\t\t\t\t\t, ast.eb_bstat_bezeichnung as akt_Status\r\n\t\t\t\t\t, fost.eb_bstat_bezeichnung as folge_Status\r\n\t\t\t\t\t, FoZu.*\r\n--\t\tDELETE\t\tFoZu\r\n\t\tFROM\t\tEB_Beleg_Status ASt\r\n\t\t\t\t\tLEFT JOIN\tEB_Beleg_Status_Folgestatus_ZO FoZu ON ast.eb_bstat_id = FoZu.eb_bstfstzo_status_eb_bstat_id\r\n\t\t\t\t\tLEFT JOIN\tEB_Beleg_Status FoSt ON FoZu.eb_bstfstzo_folgestatus_eb_bstat_id = fost.eb_bstat_id\r\n\t\tWHERE\t\tast.eb_bstat_aktiv = 1\r\n\t\t\t\t\tAND ISNULL (fost.eb_bstat_aktiv, 1) = 1\r\n\t\t\t\t\tAND ast.eb_bstat_id = fost.eb_bstat_id\r\n\t\tORDER BY\tast.eb_bstat_id\r\n\t\t\t\t\t, fost.eb_bstat_id\r\n',
